import React from 'react';
import getStaticProps from './api';

function Pages({posts}) {
  return (
      <>
      {posts.map(repo => (
          <h1 key={repo.id}>{repo.name}</h1>
        ))}
          <h1>Hello World</h1>
      </>
  );
}



export default Pages;
